import React from 'react'
import './Recomended.css'
import { useDispatch, useSelector } from 'react-redux'
function Recomended() {
  return (
    <section className="recomended">
        <h1>Recomended</h1>
        <div className="buttons">
            <Button ele="All Products"></Button>
            <Button ele="Nike"></Button>
            <Button ele="Addidas"></Button>
            <Button ele="Puma"></Button>
            <Button ele="Vans"></Button>
        </div>
    </section>
  )
}




 function Button(props) {
    let state=useSelector((state)=>state.filterreducer);
    let dis=useDispatch();
  return (
    <button onClick={()=>dis({tyoe:'recomended',payload:props.ele})}>{props.ele}</button>
  )
}




export default Recomended
